import { DailyListProps } from "@/utils/data";
import dayjs, { Dayjs } from "dayjs";

export interface getDailyListParams {
    user_id: string;
    start: Dayjs;
    end: Dayjs;
}
export const getDailyList = async(params:getDailyListParams):Promise<DailyListProps> => {
    return dailylist_dummy(start, end);
}

const dailylist_dummy = (start, end):DailyListProps => {
    return {
        start: day,
        end: day.add(7, 'days'),
        events:[
            {
                dateof: 1,
                title: "런닝머신 30분",
                abb: "런닝머신",
                content: "9km/h 5분 12km/h 5분 반복",
                icon: "running",
                date: day,
                completed: false,
                color: "#ffc8c8"
            },
            {
                dateof: 1,
                title: "영단어 100개 암기",
                content: "TOEIC 영단어 1~100",
                abb: "영단어",
                icon: "study",
                date: day,
                completed: false,
                color: "#bbbbff"
            },
            {
                dateof: 2,
                title: "영단어 100개 암기",
                content: "TOEIC 영단어 101~200",
                abb: "영단어",
                icon: "study",
                date: day.add(1, 'days'),
                completed: false,
                color: "#bbbbff"
            },
            {
                dateof: 3,
                title: "영단어 100개 암기",
                content: "TOEIC 영단어 201~300",
                abb: "영단어",
                icon: "study",
                date: day.add(2, 'days'),
                completed: false,
                color: "#bbbbff"
            },
        ]
    }
}
